Heres a focused review of the All Horses table at 325px width:

---

## 1) **Layout overflow**
**Issue:** The table fits but feels cramped; the **Category pill text is getting truncated** (e.g., Multi/War becomes Multi/Wa). This is a content overflow problem, not viewport overflow.  
**Fix:** Allow the pill to expand and/or wrap.

```css
/* category badge */
.table .category-badge {
  max-width: none;
  white-space: normal;
  padding: 6px 10px;
  line-height: 1.2;
}
```

If you cant allow wrapping, increase column width and allow horizontal scroll on table:

```css
.table-wrapper {
  overflow-x: auto;
  -webkit-overflow-scrolling: touch;
}
.table {
  min-width: 360px;
}
```

---

## 2) **Touch targets (44px min)**
**Issue:** The **Back to Horses link** is too small as a tap target (looks like text-only).  
**Fix:** Increase padding and make it a block-ish button.

```css
.back-link {
  display: inline-flex;
  align-items: center;
  padding: 10px 12px; /* => 44px height with line-height */
  line-height: 24px;
}
```

**Issue:** If table headers (Breed/Coat/Category) are clickable for sorting, the tap target is too small (text-only).  
**Fix:**

```css
.table th button {
  padding: 10px 8px;
  min-height: 44px;
  width: 100%;
  text-align: left;
}
```

---

## 3) **Text readability**
**Issue:** Body text looks a bit small for dense table rows on a phone.  
**Fix:** Slightly increase row text size and line-height.

```css
.table td,
.table th {
  font-size: 15px;
  line-height: 1.35;
}
```

**Issue:** The category badge text is low-contrast on the dark pill.  
**Fix:** Increase contrast.

```css
.category-badge {
  color: #e8e1d6;
  background: #2b2b2b;
}
```

---

## 4) **Table usability at narrow width**
**Issue:** Three-column table is too tight; long breed names wrap awkwardly.  
**Suggestion:** Switch to a stacked layout below 360px.

```css
@media (max-width: 360px) {
  .table thead {
    display: none;
  }
  .table tr {
    display: block;
    padding: 10px 0;
  }
  .table td {
    display: flex;
    justify-content: space-between;
    padding: 6px 0;
  }
  .table td::before {
    content: attr(data-label);
    font-weight: 600;
    color: #c97a4a;
  }
}
```

Youd need `data-label` on each cell (e.g., `data-label="Breed"`).

---

## 5) **Visual bugs**
**Issue:** Sorting indicator in BREED  is extremely tight to the word; looks cramped.  
**Fix:**

```css
th .sort-indicator {
  margin-left: 6px;
}
```

---

### Quick Wins (Highest Impact)
1. Fix category badge truncation.
2. Improve tap target for the Back link.
3. Consider stacked layout on small screens.

If you can share class names / structure, I can give tighter selectors.
